package main

import (
    "strconv"
    "strings"
)

// Return a string containing space-delimited numbers starting from 0 up to n inclusive.
// >>> StringSequence(0)
// '0'
// >>> StringSequence(5)
// '0 1 2 3 4 5'
func StringSequence(n int) string {
    if n < 0 {
        return ""
    }

    var sb strings.Builder
    for i := 0; i <= n; i++ {
        if i > 0 {
            sb.WriteString(" ")
        }
        sb.WriteString(strconv.Itoa(i))
    }

    return sb.String()
}
